INSERT INTO `plan` VALUES (28,'Tour por la Candelaria','Recorrido guiado a pie por el barrio histórico La Candelaria, visitando murales, arquitectura colonial, Plaza de Bolívar y Museo del Oro.','Tour a pie por el centro histórico de Bogotá.',70000,'088056bc84cc46449023b8c394537c5e.png',1,NULL,NULL,'2025-07-05 00:31:09',1),(29,'Tour Comuna 13','Visita guiada a la Comuna 13, grafitis, historia de transformación social, escaleras eléctricas y miradores. Duración 3–4 horas.','Grafiti tour en Comuna 13.',59999,'16b8dbf712ae4649a79b6273f6d80fc4.png',2,NULL,NULL,'2025-07-05 00:31:09',NULL),(32,'Tour Manglares La Boquilla ','Paseo en canoa por los manglares de La Boquilla con guía local, avistamiento de aves y taller de pesca artesanal. Duración 2 horas.','Paseo en canoa por manglares.',120000,'a043eb709da54029807e58dab366db91.png',5,NULL,NULL,'2025-07-05 00:31:09',NULL),(33,'Tour Café (Zona Cafetera)','Experiencia cafetera en finca de Quindío o Risaralda: recorrido por cafetales, proceso y cata. Duración 4 horas aprox.','Experiencia cafetera tradicional.',90000,'2f8adce976d34e578f00d7d85adb0cb2.png',2,NULL,NULL,'2025-07-05 00:31:09',NULL),(34,'Caminata al Salto del Tequenda','Caminata guiada por senderos naturales hasta el mirador de la cascada Salto del Tequendama. Duración 3 horas.','Senderismo al Salto del Tequendama.',50000,'cfee742fcb8e4bfaa718d3fd6732a99b.png',3,NULL,NULL,'2025-07-05 00:31:09',1),(35,'Monserrate & Museo del Oro ','Tour de medio día que incluye subida al cerro de Monserrate para ver vista panorámica de Bogotá + visita al Museo del Oro para conocer la colección prehispánica.','Vista y cultura en Bogotá.',190000,'28ac0779f5d34bfc82c163d88257a791.png',1,NULL,NULL,'2025-07-05 00:31:09',NULL),(36,'Mina de Sal de Zipaquirá','Excursión de medio día para visitar la Catedral de Sal; recorrido por galerías subterráneas y sala de tormentas.','Catedral de Sal.',265000,'d19f74d395f04f6ab243adc614b88e32.png',8,NULL,NULL,'2025-07-05 00:31:09',NULL),(37,'La Chorrera ','Caminata / senderismo hacia la cascada La Chorrera, con guía, naturaleza, vistas y tiempo para baño si el clima lo permite.','Cascada La Chorrera.',270000,'dcf436b3fb7d45e482b4ac52d9a5a737.png',8,NULL,NULL,'2025-07-05 00:31:09',NULL),(38,'Parque Natural Chicaque','Excursión de medio día en bosque de niebla con senderos, miradores y contacto con naturaleza cerca de Bogotá.','Bosque de niebla en Chicaque.',250000,'457b58b01b32414dbe9871cc38e5c182.png',8,NULL,NULL,'2025-07-05 00:31:09',NULL),(39,'Tour Ciudad Vieja & Castillo S','Recorrido guiado de unas pocas horas por Getsemaní, la Ciudad Amurallada y el Castillo San Felipe de Barajas, apreciando arquitectura colonial.','Historia colonial en Cartagena.',200000,'1f777466607d4efea4fe7bd254420768.png',5,NULL,NULL,'2025-07-05 00:31:09',NULL),(40,'Free Bike Tour Bogotá','Recorrido en bicicleta por zonas representativas de Bogotá, explorando parques, arte callejero y panorámicas, guiado.','Bici por Bogotá gratis.',0,'e4e0b4c8f4e8490fbf9e8e94f8bd6c35.png',1,NULL,NULL,'2025-07-05 00:31:09',NULL),(41,'Graffiti & Identity ','Tour guiado de arte urbano y grafiti en Bogotá, aprendiendo sobre los artistas, los mensajes y la transformación cultural.','Grafiti y arte urbano Bogotá.',60000,'9bfd30a35ffc44ecadd9c8ce82a30b67.png',1,NULL,NULL,'2025-07-05 00:31:09',NULL),(176,'Visionary full-range projectio','Campaña noche a justicia lenguaje. Llamado temas afirmó fecha tu principio. Hace resultados padre. Fácil medios he cabo.','R existen países nuestras.',425439,'66bd8b1ebeda405093aba72dc0501b74.jpg',2,NULL,1,'2025-11-06 21:43:03',0),(177,'Vision-oriented methodical fun','Española mujeres rosa le solución amigo análisis cosas. Don políticos g.','Grande propios barcelona.',254584,'plan_11.jpg',2,NULL,1,'2025-11-06 21:43:03',0),(178,'Optimized incremental neural-n','Popular nuevos cosas encima tribunal producto. Estructura ocasión político formación no nueva.','Muerto conocimiento toma habría.',451499,'2f8adce976d34e578f00d7d85adb0cb