CREATE DEFINER=`root`@`localhost` PROCEDURE `VerReservasPorTurista`( 

    IN NombreTurista VARCHAR(100) 

)
BEGIN 

    SELECT  

        r.fecha_reserva, 

        r.costo_final, 

        p.nombre AS plan, 

        c.nombre AS ciudad, 

        t.nombre AS turista 

