CREATE DEFINER=`root`@`localhost` PROCEDURE `VerReservasRecientesPorCiudad`( 

    IN Ciudad VARCHAR(100) 

)
BEGIN 

    SELECT  

        r.fecha_reserva,  

        r.costo_final,  

        p.nombre AS plan,  

        c.nombre AS ciudad 

    FROM reserva r 

    JOIN plan p ON p.id = r.id_plan 

    JOIN ciudad c ON c.id = p.id_ciudad 

    WHERE r.fecha_reserva >= CURDATE() - INTERVAL 30 DAY 

      AND c.nombre = Ciudad; 

END ;;
